[commands."vagrant ssh-config debian10"]
stdout = """Host debian10
  HostName 127.0.0.1
  User vagrant
  Port 2222
  UserKnownHostsFile /dev/null
  StrictHostKeyChecking no
  PasswordAuthentication no
  IdentityFile .vagrant/machines/debian10/virtualbox/private_key
  IdentitiesOnly yes
  LogLevel FATAL
"""

[commands."vagrant ssh-config ubuntu2004"]
stdout = """Host ubuntu2004
  HostName 127.0.0.1
  User vagrant
  Port 2202
  UserKnownHostsFile /dev/null
  StrictHostKeyChecking no
  PasswordAuthentication no
  IdentityFile .vagrant/machines/ubuntu2004/virtualbox/private_key
  IdentitiesOnly yes
  LogLevel FATAL
"""

[commands."vagrant status"]
stdout = """Current machine states:

